import { ThemeProvider } from "styled-components";
import Header from "./components/header/Header";
import Main from "./components/main/Main";
import { theme } from "./styles/theme";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div>
        <Header />
        <Main />
      </div>
    </ThemeProvider>
  );
}

export default App;
